const formUpdate = {
    state: {
        formUpdate: {},
    },

    getters: {
        getFormUpdate(state) {
            return state.formUpdate;
        },
    },
    mutations: {
        SET_FORM_UPDATE(state, formDangky) {
            state.formUpdate = formDangky;
        },
    },
};
export default formUpdate;
